import React, {useState, useEffect} from 'react';
import './App.css';
import {Button, Nav} from 'react-bootstrap';
import MyProfile from './Profiles/MyProfiles/Index';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';

function App() {
  return (<div className="App">
    <Router>
      <Nav>
        <Nav.Item>
          <Link to="/"></Link>
        </Nav.Item>
        <Nav.Item></Nav.Item>
      </Nav>

      <Route exact path="/" render={() => <div>Home</div>}/>
      <Route exact path="/nav1" render={() => <div>nav1</div>}/>
      <Route exact path="/nav2" render={() => <div>nav2</div>}/>
      <Route exact path="/nav3" render={() => <div>nav3</div>}/>
      <MyProfile/>
    </Router>
  </div>);
}

export default App;
